import React, {Component} from 'react';



class App extends Component{

    state = {
      cartList: []
    }

  componentDidMount() {
     fetch("http://localhost:5555/list").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <div className="container">
        <div className="col-xs-12">
        <h1>Your current Cart:</h1>
        {this.state.cartList.map((data) => (
          <div className = "data">
            <scope className = "row">
            <p className="ID">
             {data.id}
            </p>
            <p className="name">
             {data.title}
            </p>
            <p className="desc">
             {data.description}
            </p> 
            <p className="price">
             {data.price}
            </p> 
            <p className="amt">
             {data.amount}
            </p>   
            </scope>
           </div> 
        ))}
        </div>
        </div>
    );
  }

}

export default App;
